含nature:
@user-jm2nf7m6c our positions different: you think pigs, chickens, or fish are eaten, and they are cruelly killed regardless of their escape from all kinds of escapes, greedy for death.

and my position is: people and animals are just "clothes" and "tools" that have different appearances. the nature is the same. all beings are equal. they cannot eat dog meat, and they cannot eat pork, chicken, and fish.

our positions are different, logic is different.

含nature中文翻译:
@user-jm2nf7om6c 我们的立场不同：你认为猪、鸡、鱼是让人吃的，而不管它们百般逃脱、贪生怕死而照样残忍地把它们杀掉。

而我的立场是：人和动物只是外表的“衣服”、“工具”不同，本性是相同的，众生平等，不能吃狗肉，同样也不能吃猪肉、鸡肉、鱼肉。

我们立场不同，逻辑就不一样。
